import React from 'react'

function Thirdcard() {
  return (
    <div className='thirdCards'>
      <div className='thirdIcon'><i className="fa-solid fa-lightbulb"></i>
      </div>
      <div className='cardText'></div>
    </div>
  )
}

export default Thirdcard
